  render() {
    return (
      <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand href="/">Quizzards</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/groups">Groups</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    );
  }
}

export default Navigation;

